import React, { Component } from 'react';

import { FiCamera, FiSearch, FiHeart } from 'react-icons/fi';

import './index.css';

class Footer extends Component {
	render() {
		return (
			<div className='footer'>
				<FiCamera className="footer-icon" />
				<FiSearch className="footer-icon" />
				<FiHeart className="footer-icon" />
			</div>
		);
	}
}

export default Footer;
